import React, { Component } from 'react'
import Navbar from '../components/Navbar'

class Home extends Component {

    render() {
        return(
            <div className='homepage'>
                <div>

                </div>
                <h1 className='title'>Disney Harley</h1>
                <p className='brandStatement'>I am a motivated software engineer who is eager to expand my knowledge and connections to make a technical impact in the world. As a veteran of the Military I gained skills to maintain focus and attention to detail and problem solving skills. I have a passion for adventure and experiencing different cultures and ways of life. I plan to use these skills and dedication to help making dynamic and and user friendly web applications and exploring the world of design and development.</p>
            </div>
        )
    }
}

export default Home
